"use strict";
var jOrdertemp = (function() {
    var hd = "",
        grid = "";
    grid = '#gordertemp';

    function init(x) {
        hd = new Gtaxi();
        hd.setkey(x);
    }

    function rd() {
        if (hd instanceof Gtaxi) {
            return hd;
        } else {
            return undefined;
        }
    }
    return {
        init: function(a) {
            init(a);
        },
        grid: function() {
            $(grid).datagrid({
                url: rd().site_url("ordertemp/selects"),
                nowrap: true,
                singleSelect: true,
                rownumbers: true,
                fit: true,
                striped: true,
                autoRowHeight: false,
                pagination: true,
                fitColumns: false,
                method: "post",
                halign: "center",
                queryParams: {
                    'taxixkey': rd().getkey()
                },
                columns: [
                    [{
                        halign: "center",
                        title: "id_assgn_order",
                        field: "id_assgn_order"
                    }, {
                        halign: "center",
                        title: "id_temp_order",
                        field: "id_temp_order"
                    }, {
                        halign: "center",
                        title: "timecreate",
                        field: "timecreate"
                    }, {
                        halign: "center",
                        title: "id_req_taxi",
                        field: "id_req_taxi"
                    }, {
                        halign: "center",
                        title: "id_taxi_device",
                        field: "id_taxi_device"
                    }, {
                        halign: "center",
                        title: "queue",
                        field: "queue"
                    }, {
                        halign: "center",
                        title: "addrs_pickup",
                        field: "addrs_pickup"
                    }, {
                        halign: "center",
                        title: "addrs_clue",
                        field: "addrs_clue"
                    }, {
                        halign: "center",
                        title: "customer_random_id",
                        field: "customer_random_id"
                    }, {
                        halign: "center",
                        title: "latitude",
                        field: "latitude"
                    }, {
                        halign: "center",
                        title: "longitude",
                        field: "longitude"
                    }, {
                        halign: "center",
                        title: "name",
                        field: "name"
                    }, {
                        halign: "center",
                        title: "phone_number",
                        field: "phone_number"
                    }, {
                        halign: "center",
                        title: "rc",
                        field: "rc"
                    }, {
                        halign: "center",
                        title: "time_req",
                        field: "time_req"
                    }, {
                        halign: "center",
                        title: "time_rsp",
                        field: "time_rsp"
                    }, {
                        halign: "center",
                        title: "id_customer",
                        field: "id_customer"
                    }, {
                        halign: "center",
                        title: "id_taxi",
                        field: "id_taxi"
                    }, {
                        halign: "center",
                        title: "last_update_pos_time",
                        field: "last_update_pos_time"
                    }, {
                        halign: "center",
                        title: "taxi_status",
                        field: "taxi_status"
                    }, {
                        halign: "center",
                        title: "nik",
                        field: "nik"
                    }]
                ]
            });
        }
    }
})();
